import React from 'react';
import Contact from './contact.js';

class ContactPane extends React.Component {
   render(){
      return(
         <div id="contact-pane-container" class={this.props.show}>
            <div id="contact-pane">
               <Contact displayName="Good charitable company" />
            </div>
         </div>
      );
   }
}

export default ContactPane;
